import { Box, Heading } from "@chakra-ui/react";
import React from "react";
import ProjectChild from "../Components/Projectchild";
import Fasionpoint from "../Image/Fasionpoint.png";
import Houseware from "../Image/Houseware.png";
import TMatrix from "../Image/TMatrix.png";
import { FaDharmachakra, FaReact } from "react-icons/fa";
import { SiJson } from "react-icons/si";
import { IoLogoCss3 } from "react-icons/io";
import { SiJavascript } from "react-icons/si";
import { TiHtml5 } from "react-icons/ti";
const Projects = () => {
  const fashionPointLink = [
    // HTML | CSS | JS | MockAPI
    { icon: FaReact, title: "React JS" },
    { icon: FaDharmachakra, title: "Chakra UI" },
    { icon: SiJson, title: "JSON Server" },
  ];
  const HourewareLink = [
    // HTML | CSS | JS | MockAPI
    { icon: TiHtml5, title: "HTML" },
    { icon: IoLogoCss3, title: "CSS" },
    { icon: SiJavascript, title: "JavaScript" }
  ];
  const fashionPointText = {
    title: "FASHION POINT - Clone",
    desc: "  It is a E-Commerce website. There are many items available",
    deploy: "https://cute-cobbler-edfe4e.netlify.app/",
    gitRepo: "https://github.com/bire210/spiky-plate-7313",
    image: Fasionpoint,
    feature: [
      "  User can Login or Signup",
      "Home page",
      "Product Page",
      "Cart page",
      "Payment Gateway",
      "Admin Page",
    ],
  };
  const AmezonText = {
    title: "AMEZON.IN - Clone",
    desc: "  It is a E-Commerce website. There are many items available",
    deploy: "https://cute-cobbler-edfe4e.netlify.app/",
    gitRepo: "https://github.com/kallol0011/alleged-partner-6503",
    image: Fasionpoint,
    feature: [
      "  User can Login or Signup",
      "Home page",
      "Product Page",
      "Cart page",
      "Payment Gateway",
      "Admin Page",
    ],
  };

  const HousewareText = {
    title: "HOUSEWARE - Clone",
    desc: " It is a E-Commerce website.On this website every items are available for home decoration.",
    deploy: "https://housewareshivam.netlify.app/",
    gitRepo: "https://github.com/sp740881/pro-comparison-6419",
    image: Houseware,
    feature: [
      "  User can Login or Signup",
      "Add to Cart",
      "Searching",
      "Sorting",
      "Filtering",
      "Authentication",
      "Payment Option",
    ],
  };
  const TmatrixText = {
    title: "TMATRIC - Clone",
    desc: " It is Timer website. It is Solo Project",
    deploy: "https://spiffy-cascaron-a2002b.netlify.app",
    gitRepo: "https://github.com/sp740881/upbeat-eggnog-8021",
    image: TMatrix,
    feature: [
      "  User can Login or Signup",
      "Home page",
      "Suppot Pager",
      "Blog page",
    ],
  };
  return (
    <Box id="projects" overflow={"hidden"}>
      <Heading>Projects</Heading>
      <ProjectChild techStack={fashionPointLink} project={fashionPointText} />
      <ProjectChild techStack={HourewareLink} project={TmatrixText} />
      <ProjectChild techStack={fashionPointLink} project={HousewareText} />
    
    </Box>
  );
};

export default Projects;
